import React from "react";

function Nav() {
  return (
    <div className="navbar">
      <img className="netflix_logo" src="netflixlogo.jpg" alt="Netflix Logo" />
      <img className="nav_avatar" src="" alt="Avatar" />
    </div>
  );
}

export default Nav;
